import React from 'react';

import ScrollingCarousel from '@trendyol-js/react-carousel';
import Item  from './yourItem';



function Carousel() {
  return (
    <Carousel>
		<Item />
		<Item />
		<Item />
		<Item />
	</Carousel>
)};



export default ScrollingCarousel;
